import { CHANGE_SEARCH_FIELD, REQUEST_ROBOTS } from "./constants";

export const setSearchField = (text) => ({
  type: CHANGE_SEARCH_FIELD,
  payload: text,
});

export const setRobotsRequest = (data) => ({
  type: REQUEST_ROBOTS,
  payload: data,
});
